import Navigatiebalk from './components/Navigatiebalk/Navigatiebalk.vue';
import Producten from './components/Producten/Producten.vue';




export default {
    name: 'App',
    components: {
        Navigatiebalk,
        Producten,
     
    },

    data() {
        return {
            message: 'Welkom bij de Lunch Applicatie',
        };
    }
};
